import React from 'react'

import {
    Link
  } from "react-router-dom";

function Menu() {
  return (
    <div className="menu" role='menubar'>
        <nav>
            <ul>
                <li><Link to="/"></Link>Transactions</li>
                <li><Link to="/ReportsPage"></Link>Reports</li>
                <li><Link to="/AddUserPage"></Link>Add Users</li>
            </ul>
        </nav>
    </div>
  );
}

export default Menu;
